import React from "react";

function ContactUs() {
  return (
    <div className="flex justify-center items-center h-screen">
      <h1>Contact Us</h1>
      <p>If you have any questions, please reach out to us at contact@project.com</p>
    </div>
  );
}

export default ContactUs;
